import MasterData from './images/masterdata.png';
import Dealer from './images/dealer.png';
import Distributor from './images/distributor.png';
import Inventory from './images/inventory.png';
import User from './images/user.png';
import Offers from './images/offers.png';
import Target from './images/target.png';
import InventoryVision from './images/inventoryVision.png';
const data = [
  {
    title: 'Master Data',
    image: MasterData,
    link: '/masterdata',
  },
  {
    title: 'Dealer',
    image: Dealer,
    link: 'dealer',
  },
  {
    title: 'Distributor',
    image: Distributor,
    link: 'distributor',
  },
  {
    title: 'inventory',
    image: Inventory,
    link: 'inventory',
  },
  {
    title: 'User',
    image: User,
    link: 'user',
  },
  {
    title: 'Offers',
    image: Offers,
    link: 'offers',
  },
  {
    title: 'Target',
    image: Target,
    link: 'target',
  },
  {
    title: 'Inventory Vision',
    image: InventoryVision,
    link: 'inventoryVision',
  },
];
export default data;
